SOUND ON 🔈 - Essa é a minha Seleção do Ano no @easportsfifabrasil. O que você achou? 🔥- #FIFA21 #TOTY

//

SOUND ON 🔈 - This is my Team Of The Year on @easportsfifa. What do you think? 🔥- #FIFA21 #TOTY,@paulodybala, @douglascosta e @richarlison! Vocês amam @fortnite.br.oficial e amam futebol. Eu sei que o @neymarjr e o @pepe também são craques. E o @21_para é um dos capitães do time que eu amo. Por isso, eu convido todos vocês para jogarem o Campeonato Pelé! Uma competição especial que vai acontecer dentro do game em minha homenagem no dia 20 de janeiro. 

Sei que serei bem representado por vocês. E por favor, tragam mais uma taça para a minha coleção. #PeleCupFortnite

//

@paulodybala, @douglascosta and @richarlison! You love @fortnite and you love football. I know @neymarjr and @pepe are also great players. And @21_para is one of the captains of the team that I love. So, I invite you to play the Pelé Cup! A special competition that will happen within the game in my honor on January 20th.

I know that I will be well represented by you. And please, bring another trophy to my collection.

#PeleCupFortnite,Realmente foi uma explosão de alegria! E o pessoal do @fortnite.br.oficial me homenageou, recriando o meu soco no ar no jogo. Participe do Campeonato Pelé e confira o meu Gesto Soco No Ar e o novo Conjunto Pontapé Inicial! #PeleCupFortnite

//

It really was an explosion of joy! And the @fortnite team paid tribute to my celebration, recreating my air punch in the game. Join the Pelé Cup and check out my Emote Air Punch and the new Kickoff Set! #PeleCupFortnite,Em breve, eu terei a oportunidade de reviver as minhas memórias. No dia 23 de fevereiro, minha história será contada em um documentário produzido pela @netflixbrasil. Estou empolgado para assistir! #PeleNetflix

//⠀
⠀
Soon, I will have the opportunity to relive my memories. On February 23, my story will be told in a documentary produced by Netflix. I'm excited to watch!,Hoje é o dia da decisão. E essa não é só uma foto de um time. Mas sim, de amigos que corriam, que lutavam e viveram seus melhores dias juntos. Que construíram uma jornada única e inesquecível. Hoje, eu desejo que o passado desse clube cheio de história, pioneirismo e coragem para fazer o que nenhum outro fazia, sirva de inspiração. Pois eu sei que podemos criar ainda mais coragem para fazer tudo de novo. Eu acredito em vocês e vou torcer até o fim! Vamos, @SantosFC!  #PeloTetraDaLiberta 

//

Today is decision day. And this is not just a photo of a team. It’s a photo of friends who ran, who fought and lived their best days together. Who built a unique and went on an unforgettable journey. Today, I wish that the past of this club, full of history, a pioneering spirit and the courage to do what no one else did, can be an inspiration. May these words give you the courage to do it all over again. I believe in you and I will cheer until the end! Let's go, @SantosFC!,Não importa o tamanho do desafio. Nós temos sempre que continuar lutando, driblando e acima de tudo: acreditando! Essa é uma lição do futebol, mas que também serve para a vida. Hoje é dia de mais uma batalha. É dia de construir mais um capítulo na história da @libertadores. Eu estarei na torcida por vocês, @SantosFC. #PeloTetraDaLiberta 

//

It doesn't matter how big the challenge may be. We always have to keep fighting, dribbling and above all: believing! This is a lesson in football, and also in life. Today is another battle day. It is a day to write another chapter in the history of @libertadores. I'll be cheering for you, @SantosFC. #PeloTetraDaLiberta,Acabou! Feliz Ano Novo! Que 2021 seja um ano bem melhor para todos nós! 

// 

It's over! Happy New Year! May 2021 be a much better year for all of us!,O ano está quase acabando! Vamos encarar mais um dia com bom humor! Você já fez alguém sorrir hoje? ⠀
 ⠀
// ⠀
⠀
The year is almost over! Let's face another day in a good mood! Have you made anyone smile today?,Estamos chegando ao final dessa grande e cansativa partida. Vamos sair vencedores. E iremos nos abraçar no final!

// 

We are reaching the end of this great and tiring game. We will come out winners. And we will embrace at the end!,Meus amigos, aqui está a minha mensagem de Natal para vocês. Eu espero que assistam e que saibam que eu admiro a todos vocês. 

// 

My friends, a Christmas message for you. I hope you watch and know I admire you all.

