Today is decision day. And this is not just a photo of a team. It’s a photo of friends who ran, who fought and lived their best days together. Who built a unique and went on an unforgettable journey. Today, I wish that the past of this club, full of history, a pioneering spirit and the courage to do what no one else did, can be an inspiration. May these words give you the courage to do it all over again. I believe in you and I will cheer until the end! Let's go, @SantosFC!,Não importa o tamanho do desafio. Nós temos sempre que continuar lutando, driblando e acima de tudo: acreditando! Essa é uma lição do futebol, mas que também serve para a vida. Hoje é dia de mais uma batalha. É dia de construir mais um capítulo na história da @libertadores. Eu estarei na torcida por vocês, @SantosFC. #PeloTetraDaLiberta 

//

It doesn't matter how big the challenge may be. We always have to keep fighting, dribbling and above all: believing! This is a lesson in football, and also in life. Today is another battle day. It is a day to write another chapter in the history of @libertadores. I'll be cheering for you, @SantosFC. #PeloTetraDaLiberta,Acabou! Feliz Ano Novo! Que 2021 seja um ano bem melhor para todos nós! 

// 

